import React, { useEffect } from "react";
import { useDispatch, useSelector} from "react-redux";
import { getAllDogs } from "../../redux/action-creators";
import { Card } from "../Card/Card";

export const Home = () => {
    
    const allDogs = useSelector((state) => state.allDogs);

    useEffect(() => {
        const dispatch = useDispatch();
        dispatch(getAllDogs())
    }, [])


   return (
        <div>
            Home
            {allDogs.map((dog) => {
                if(dog.hasOwnProperty("temperament")) {
                return (
                <Card
                key={dog.id} 
                name={dog.name}
                weight={dog.weight.metric}
                image={dog.image.url}
                temperament={dog.temperament}
                id={dog.id}
                
            />
                )
                } else if (dog.hasOwnProperty("tempers")) {
                    return (
                    <Card
                key={dog.id} 
                name={dog.name}
                weight={dog.weight.metric}
                image={dog.image.url}
                temperament={dog.tempers[0].temper_name}
                id={dog.id}
            />
                    )
                }

                else {
                    return (
                        <Card
                        key={dog.id} 
                        name={dog.name}
                        weight={dog.weight.metric}
                        image={dog.image.url}
                        id={dog.id}                       
                    />
                        )
                }
            })}

        </div>
    )
}
